package allJavaProgram;

public class GCD {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=50;
		int b=60;
		while(a!=b)
		{
			if(a>b)
			{
				a=a-b;
			}
			else
			{
				b=b-a;
			}}
			System.out.println("GCD OF NUMBER "+b);
		}

	}


